CREATE TABLE TblSmartAR (
    [Customer] NVARCHAR(40),
    [Invoice_No] NVARCHAR(10),
    [Invoice_Date] DATE,
    [Due_Date] DATE,
    [Invoice_Amount] INT,
    [Payment_Date] DATE,
    [OverDue_Days] INT,
    [Due_Date_only] INT,
    [Due_Month] INT,
    [Due_year] INT
);
